			["customText"] = "function()\n    \n    local pi = math.pi\n    local face = GetPlayerFacing();\n    local px,py,pz,pid = UnitPosition(\"player\");\n    local number = 0;\n    for i=1,30 do\n        if UnitExists(\"raid\"..i) then\n            local tx,ty,tz,tid = UnitPosition(\"raid\"..i);\n            if pid==tid then \n                \n                local dx = tx - px;\n                local dy = ty - py;\n                local D = sqrt(dx^2+dy^2);\n                local alfa = 0;\n                if D>0 and D<30 then\n                    if dx>=0 then alfa = rad(asin(dy/D)) end\n                    if dx<0 then alfa = pi -  rad(asin(dy/D)) end\n                    \n                    local dangle = abs((face-alfa)%(2*pi)) \n                    if  dangle <= pi/3 or dangle >= 5/3*pi then\n                        number = number +1\n                    end    \n                end\n                if D==0 then number = number+1 end\n            end    \n        end    \n    end \n    \n    if number ==0 then return \"\" end\n    return number;\nend\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
